import csvimport urllib#Read in stock tickers from data and look up listing exchange via Yahoo Finance APIlistings = []with open('stock_list.csv', 'rb') as csvfile:    reader = csv.reader(csvfile, delimiter=' ', quotechar='|')    for row in reader:        url = "http://query.yahooapis.com/v1/public/yql?q=select%20*%20from%20yahoo.finance%20.quotes%20where%20symbol%20in%20(%22" + str(row[0]) + "%22)%0A%09%09&diagnostics=true&env=http%3A%2F%2Fdatatables.org%2Falltables.env"        page = urllib.urlopen(url).read()        try:            exchange=page.split("<StockExchange>")[1].split("</StockExchange>")[0]        except:            exchange='NA'        print(row)        print(exchange)        listings.append(exchange)#Write to output filewith open('Exchange.csv', 'wb') as f:    writer = csv.writer(f)    writer.writerows(listings)